import './Main.css';

function Main() {
  return (
    <div id='mainBody'>
        <div id="notesSideBar">
         
          <div id="note">
              <input type="text" id="title" placeholder='Enter title'/>
              <textarea type="text" id="text" placeholder='Enter text'/>
          </div>
        </div>
        <div id="notesList">
          <h1 id="notedHeader"> NOTES </h1>
        </div>
    </div>
  );
}

export default Main;
